mediaconvert_create_preset <- function(Category = NULL, Description = NULL, Name, Settings, Tags = NULL) {
  op <- new_operation(
    name = "CreatePreset",
    http_method = "POST",
    http_path = "/2017-08-29/presets",
    paginator = list()
  )
  input <- .mediaconvert$create_preset_input(Category = Category, Description = Description, Name = Name, Settings = Settings, Tags = Tags)
  output <- .mediaconvert$create_preset_output()
  config <- get_config()
  svc <- .mediaconvert$service(config)
  request <- new_request(svc, op, input, output)
  response <- send_request(request)
  return(response)
}
.mediaconvert$operations$create_preset <- mediaconvert_create_preset

