#' @keywords internal
#'
#' @rdname mediaconvert_get_job
mediaconvert_get_job <- function(Id) {
  op <- new_operation(
    name = "GetJob",
    http_method = "GET",
    http_path = "/2017-08-29/jobs/{id}",
    paginator = list()
  )
  input <- .mediaconvert$get_job_input(Id = Id)
  output <- .mediaconvert$get_job_output()
  config <- get_config()
  svc <- .mediaconvert$service(config)
  request <- new_request(svc, op, input, output)
  response <- send_request(request)
  return(response)
}
.mediaconvert$operations$get_job <- mediaconvert_get_job

