#'
#' @keywords internal
#'
#' @rdname mediaconvert_get_job_template
mediaconvert_get_job_template <- function(Name) {
  op <- new_operation(
    name = "GetJobTemplate",
    http_method = "GET",
    http_path = "/2017-08-29/jobTemplates/{name}",
    paginator = list()
  )
  input <- .mediaconvert$get_job_template_input(Name = Name)
  output <- .mediaconvert$get_job_template_output()
  config <- get_config()
  svc <- .mediaconvert$service(config)
  request <- new_request(svc, op, input, output)
  response <- send_request(request)
  return(response)
}
.mediaconvert$operations$get_job_template <- mediaconvert_get_job_template

