mediaconvert_get_preset <- function(Name) {
  op <- new_operation(
    name = "GetPreset",
    http_method = "GET",
    http_path = "/2017-08-29/presets/{name}",
    paginator = list()
  )
  input <- .mediaconvert$get_preset_input(Name = Name)
  output <- .mediaconvert$get_preset_output()
  config <- get_config()
  svc <- .mediaconvert$service(config)
  request <- new_request(svc, op, input, output)
  response <- send_request(request)
  return(response)
}
