#'   NextToken = "string",
#'   Order = "ASCENDING"|"DESCENDING"
#' )
#' ```
#'
#' @keywords internal
#'
#' @rdname mediaconvert_list_job_templates
mediaconvert_list_job_templates <- function(Category = NULL, ListBy = NULL, MaxResults = NULL, NextToken = NULL, Order = NULL) {
  op <- new_operation(
    name = "ListJobTemplates",
    http_method = "GET",
    http_path = "/2017-08-29/jobTemplates",
    paginator = list()
  )
  input <- .mediaconvert$list_job_templates_input(Category = Category, ListBy = ListBy, MaxResults = MaxResults, NextToken = NextToken, Order = Order)
  output <- .mediaconvert$list_job_templates_output()
  config <- get_config()
  svc <- .mediaconvert$service(config)
  request <- new_request(svc, op, input, output)
  response <- send_request(request)
  return(response)
}
.mediaconvert$operations$list_job_templates <- mediaconvert_list_job_templates

