#'   Status = "SUBMITTED"|"PROGRESSING"|"COMPLETE"|"CANCELED"|"ERROR"
#' )
#' ```
#'
#' @keywords internal
#'
#' @rdname mediaconvert_list_jobs
mediaconvert_list_jobs <- function(MaxResults = NULL, NextToken = NULL, Order = NULL, Queue = NULL, Status = NULL) {
  op <- new_operation(
    name = "ListJobs",
    http_method = "GET",
    http_path = "/2017-08-29/jobs",
    paginator = list()
  )
  input <- .mediaconvert$list_jobs_input(MaxResults = MaxResults, NextToken = NextToken, Order = Order, Queue = Queue, Status = Status)
  output <- .mediaconvert$list_jobs_output()
  config <- get_config()
  svc <- .mediaconvert$service(config)
  request <- new_request(svc, op, input, output)
  response <- send_request(request)
  return(response)
}
.mediaconvert$operations$list_jobs <- mediaconvert_list_jobs

